    const navigate=useNavigate();
    const [pd,spd] = useState({})
    useEffect(()=>{
        const sr=async()=>{
            await axios.get("http://localhost:4000/bs1r").then((res)=>{
                spd(res.data);
            })
        }
        sr();
    },[]);
    const cr = () => {
        navigate("/result");
      };
  return (
    <div className="sr">
      <div className="rc">
        <button id="rc" onClick={cr}>
          X
        </button>
      </div>
      <div className="pd">
        <div className="w">WINNER : 100</div>
        <div className="r">RUNNER : 50</div>
        <div className="k">KILL : 10</div>
      </div>
      <table>
        <tr>
            
          <th>POSITION</th>
          <th>PLAYER NAME</th>
          <th>KILLS</th>
          <th>CASH</th>
        </tr>
        <tr>
            {
                    <>
                    <td>{pd[0]}</td>
                    <td>tjt</td>
                    <td>gfhj</td>
                    <td>fgj</td>
                    </>
                
                
                
            }
        </tr>
      </table>
    </div>
  )
}
export default Bsolo1r
